text:
Është duke vazhduar procesi i numërimit të votave të kandidatëve për deputetë në Qendrat Komunale të Numërimit në komunat e ndryshme të Kosovës. 

Mëngjesin e së premtes (14 shkurt) ky poces ka filluar edhe në komunën e Istogut dhe Rahovecit. Gjatë pasdites, në orën 16:00, planifikohet që numërimi të fillojë në QKN-të në komunat Pejë dhe Podujevë. 

Numërimi në komuna ka filluar sipas këtyre datave: 

11 shkurt 2025 - Prishtinë, Lipjan, Obiliq dhe Partesh; 
12 shkurt 2025 – Deçan, Gjakovë, Drenas, Gjilan, Fushë Kosovë., Kamenicë, Mitrovicë e Jugut, Skënderaj, Shtërpcë, Viti, Ranillug, Kllokot, Mitrovicë e Veriut dhe Han i Elezit; 
13 shkurt 2025 – Suharekë, Ferizaj, Vushtrri, Kaçanik, Novobërdë, Prizren, Shtime dhe Junik.
——-

Proces brojanja glasova kandidata za poslanike u Opštinskim centrima za brojanje u različitim opštinama Kosova se nastavlja.

U petak ujutro (14. februar), ovaj proces je započeo i u opštinama Istog i Orahovac. Tokom popodneva, u 16:00 časova, planira se da brojanje počne u OCP u u opštinama Peć i Podujevo.

Brojanje u opštinama počelo je prema sledećim datumima:

februar 2025. - Priština, Lipjan, Obilić i Partesh;
februar 2025. – Dečani, Ðakovica, Drenas, Kosovo Polje, Kamenica, Južni Mitrovica, Skenderaj, Štrpce, Vitna, Ranilug, KLokot, Severna Mitrovica i Elez Han;
februar 2025. – Suva Reka, Uroševac, Vučitrn, Kačanik, Novobrdo, Prizren, Štimlje i Junik.
